import React from 'react';
import { Link } from 'react-router-dom';
import { Button, Form, Row, Col, Layout } from 'antd';
import { Icon } from '@iconify/react';
import threeDots from '@iconify/icons-bi/three-dots';
import '../Styles/FormHome.css';
import 'antd/dist/reset.css';

const { Header } = Layout;

const Home = () => {
  return (
    <div style={{backgroundColor: '#462A50', Height: '10vh', position: 'relative', display: 'flex', flexDirection: 'column', justifyContent: 'space-between'}}>
        <div className="circle-background"></div>
        <Icon icon={threeDots} className='ThreePointsHome'/>
        <div style={{ textAlign: 'center', padding: '2rem' }}>
            <img src="https://www.nacion-seguros.com.ar/wp-content/uploads/2023/08/icono-siniestro.png" alt="HomeImage" className='HomeImage' style={{ maxWidth: '100%', height: 'auto' }} />
            <p className='Welcome'>Bienvenido</p>
        </div>
      <Row justify="center" align="middle" style={{ flexGrow: 1, padding:'24px'}}>
        <Col xs={24} sm={16} md={12} lg={8}>
          <Form layout="vertical" style={{ padding: '1rem', borderRadius: '30px', border:'0.5px solid white'}}>
            <Form.Item style={{marginTop: '10px'}}>
              <Link to="/#">
                <Button className='Buttons' block>
                    <p>Iniciar sesión</p>
                </Button>
              </Link>
            </Form.Item>
            <Form.Item style={{marginTop: '10px'}}>
              <Link to="/RegistrarAjustador">
                <Button className='Buttons' block>
                  <p>Registrarse</p>
                </Button>
              </Link>
            </Form.Item>
          </Form>
        </Col>
      </Row>
      <Layout>
        <Header style={{ backgroundColor: '#222222', textAlign: 'center'}}>
          <p className="TextFooter">Cesvi Mexico ©</p>
        </Header>
      </Layout>
    </div>
  );
};

export default Home;
